import React from "react";
import {useParams} from "react-router-dom";
import {todos} from "./Todos.jsx";

const Todo =()=>{

    const {id}=useParams();

return( 

	<React.Fragment>

	<h1> To do number {id}</h1>

	{todos.map((todo)=>{


		if(todo.id==id){


			return(`<h5>todo.id</h5>`);
		}


	})



	}

	</React.Fragment>
);


}


export default Todo;
